import{_ as e,o,c as t,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 13.1-766.1 Merger of foreign corporation authorized to transact business in Commonwealth.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-766.1.md","filePath":"vacode/13.1-766.1.md"}'),i={name:"vacode/13.1-766.1.md"},a=r('<h1 id="§-13-1-766-1-merger-of-foreign-corporation-authorized-to-transact-business-in-commonwealth" tabindex="-1">§ 13.1-766.1 Merger of foreign corporation authorized to transact business in Commonwealth. <a class="header-anchor" href="#§-13-1-766-1-merger-of-foreign-corporation-authorized-to-transact-business-in-commonwealth" aria-label="Permalink to &quot;§ 13.1-766.1 Merger of foreign corporation authorized to transact business in Commonwealth.&quot;">​</a></h1><p>A. Whenever a foreign corporation authorized to transact business in the Commonwealth is a party to a merger permitted by the laws of its jurisdiction of formation, and such foreign corporation is the surviving entity of the merger, it shall, within 30 days after such merger becomes effective, file with the Commission a copy of the instrument of merger duly authenticated by the Secretary of State or other official having custody of corporate records in its jurisdiction of formation; however, the filing shall not be required when a foreign corporation merges with a domestic corporation or eligible entity, the foreign corporation&#39;s articles of incorporation are not amended by said merger, and the articles or statement of merger filed on behalf of the domestic corporation or eligible entity pursuant to § <a href="/vacode/13.1-720/">13.1-720</a>, <a href="/vacode/13.1-1072/">13.1-1072</a>, <a href="/vacode/13.1-1261/">13.1-1261</a>, <a href="/vacode/50-73.48:3/">50-73.48:3</a>, or <a href="/vacode/50-73.13/">50-73.13</a>1 contains a statement that the participation of the foreign corporation was duly authorized as required by its organic law.</p><p>B. Whenever a foreign corporation authorized to transact business in the Commonwealth is a party to a merger permitted by the laws of its jurisdiction of formation, and such corporation is not the surviving entity of the merger or, whenever such a foreign corporation is a party to a consolidation so permitted, the surviving or resulting foreign corporation or eligible entity, if there is one, shall, if not continuing to transact business in the Commonwealth, within 30 days after such merger or consolidation becomes effective, deliver to the Commission a copy of the instrument of merger or consolidation duly authenticated by the Secretary of State or other official having custody of corporate records in the foreign corporation&#39;s jurisdiction of formation, and comply in behalf of the predecessor corporation with the provisions of § <a href="/vacode/13.1-767/">13.1-767</a>. However, if the surviving or resulting foreign corporation or eligible entity is to continue to transact business in the Commonwealth and has not obtained a certificate of authority or a certificate of registration to transact business in the Commonwealth then, within such 30 days, it shall deliver to the Commission an application for a certificate of authority or a certificate of registration to transact business in the Commonwealth, pursuant to and in compliance with § <a href="/vacode/13.1-759/">13.1-759</a>, <a href="/vacode/13.1-921/">13.1-921</a>, <a href="/vacode/13.1-1052/">13.1-1052</a>, <a href="/vacode/13.1-1242/">13.1-1242</a>, <a href="/vacode/50-73.54/">50-73.54</a>, or <a href="/vacode/50-73.138/">50-73.138</a>, as applicable.</p><p>C. Upon the merger or consolidation of a foreign corporation with one or more foreign corporations or eligible entities, all property in the Commonwealth owned by any of the foreign corporations or eligible entities shall pass to the surviving or resulting foreign corporation or eligible entity except as otherwise provided by the laws of its jurisdiction of formation, but only from and after the time when a duly authenticated copy of the instrument of merger or consolidation is filed with the Commission.</p><p>1986, c. 571; 1990, c. 283; 1992, c. 575; 1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0190" target="_blank" rel="noreferrer">190</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0274" target="_blank" rel="noreferrer">274</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0663" target="_blank" rel="noreferrer">663</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0623" target="_blank" rel="noreferrer">623</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0734" target="_blank" rel="noreferrer">734</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1226" target="_blank" rel="noreferrer">1226</a>.</p>',5),n=[a];function s(c,h,f,l,g,d){return o(),t("div",null,n)}const u=e(i,[["render",s]]);export{m as __pageData,u as default};
